package db.domain;import java.util.Arrays;public class AvoidFighterImpl implements AvoidFighter {	@Key	private String uname;	private boolean isFighter;	private int startTime;	public AvoidFighterImpl() {	}	public AvoidFighterImpl(AvoidFighter c) {		this.uname = c.getUname();		this.isFighter = c.getIsFighter();		this.startTime = c.getStartTime();	}	@Override	public String tableName() {		return "avoid_fighter";	}	public void setUname(String uname) {		this.uname = uname;	}	public String getUname() {		return this.uname;	}public void addUname(String uname) {		this.uname += uname;}	public void setIsFighter(boolean isFighter) {		this.isFighter = isFighter;	}	public boolean getIsFighter() {		return this.isFighter;	}	public void setStartTime(int startTime) {		this.startTime = startTime;	}	public int getStartTime() {		return this.startTime;	}public void addStartTime(int startTime) {		this.startTime += startTime;}}